HPSESSID\':\'2up1k5lc93c78uhfdgvigftih7\'\\n}\\nres=requests.get(url=url,cookies=cookie)\\nprint(res.text)\\n\\n```\\n\\n拿到 flag\\n<img src=\\\"https://upload.d1lete.online/article/7988297e05e3cd501f60bf04ee1b2545.png\\\"\\n/>\\n\\n## 0x02 Unix:AAAA 套接字漏洞\\n\\nApache HTTP Server SSRF 漏洞（CVE-2021-40438）\\n在其 2.4.48 及以前的版本中，mod_proxy 模块存在一处逻辑错误导致攻击者可以控制反向代理服务器的地址，进而导致 SSRF 漏洞\\n\\n[CVE-2021-40438 详细漏洞分析](https://blog.csdn.net/kali_Ma/article/details/121388165)\\n\",\"articleCover\":\"https://upload.d1lete.online/article/8fee7071d2e9d3ec4ddfb5b541e47552.jpg\",\"articleTitle\":\"ISCC2024 掉进阿帕奇的工资\",\"articleType\":1,\"categoryName\":\"ISCC人民的好比赛\",\"id\":74,\"isRecommend\":1,\"isTop\":1,\"status\":1,\"tagNameList\":[]}]', 'PUT', '{\"code\":200,\"flag\":true,\"msg\":\"操作成功\"}', 1, '无限缤纷', '36.149.38.251', '中国|江苏省|泰州市|移动', 77, '2024-06-08 17:16:57');
