INSERT INTO `t_operation_log` VALUES (1245, '文章模块', '修改', '/admin/article/update', 'com.ican.controller.ArticleController.updateArticle', '修改文章', '[{\"articleContent\":\"### 0x01 pwtools\\n\\n确认你已安装 Python 和 pip。如果你还没有安装，先安装 Python 和 pip。\\n\\n打开终端或命令行窗口，输入以下命令安装 pwntools:\\n\\npip install pwntools\\n\\n安装完成后，您可以在 Python 脚本中导入 pwntools，例如:\\n\\nfrom pwn import *\\n\\n### 0x02 pwntools 常用模块\\n\\n```python\\nasm                  汇编与反汇编\\n\\ndynelf               远程符号泄露\\n\\nelfelf               文件操作\\n\\ngdb                  启动gdb调试\\n\\nshellcraft           shellcode的生成器\\n\\ncyclic               pattern偏移字符计算\\n\\nprocess/remote       读写接口\\n```\\n\\n### 0x03 数据交互\\n\\n```python\\n\\nio = remote(\'url\', port)        创建一个远程连接\\n\\nio = process(\\\"./文件名\\\")         创建一个本地连接\\n\\nio.send(\\\"data\\\")                 发送一行数据\\n\\nio.sendline(\\\"data\\\")             发送一行数据,并在末尾加\\\\n\\n\\nio.recv()                       接受数据\\n\\nio.recvline()                   接受一行数据\\n\\nio.interactive()                建立交互shell\\n\\n\\nio.sendafter(b\\\"some_string\\\",data) \\t接收到some_string后，发送payload\\n\\nio.recvuntil(b\\\"somestring\\\")             接受到some_string为止\\n\\nio.recvuntil(b\\\"\\\\n\\\", drop = True) \\t接受到\\\\n为止,但不包括\\\\n\\n\\n\\n```\\n\\n### 0x04 ELF 模块\\n\\n```python\\nelf = ELF(\'./文件名\')\\n\\nelf.address                     elf 基地址\\n\\nelf.bss()                       elf bss 段\\n\\nelf.plt[\'function\']             plt[] 表项对应地址\\n\\nelf.got[\'function\']             got[] 表项对应地址\\n\\nelf.symbols[\'function\']         查看对应符号函数/数据所在地址\\n\\nelf.search[\'/bin/sh\']           返回一个迭代器，用next()获取\\n\\n```\\n                                         \",\"articleCover\":\"https://upload.d1lete.online/article/8fa019d1ad4910633e77f10f346aae08.jpg\",\"articleTitle\":\"pwntools\",\"articleType\":1,\"categoryName\":\"PWN新手村\",\"id\":73,\"isRecommend\":1,\"isTop\":1,\"status\":1,\"tagNameList\":[]}]', 'PUT', '{\"code\":200,\"flag\":true,\"msg\":\"操作成功\"}', 1, '无限缤纷', '36.149.38.251', '中国|江苏省|泰州市|移动', 75, '2024-06-08 17:20:23');
INSERT INTO `t_operation_log` VALUES (1246, '文章模块', '修改', '/admin/article/update', 'com.ican.controller.ArticleController.updateArticle', '修改文章', '[{\"articleContent\":\"### 0x01 pwtools\\n\\n确认你已安装 Python 和 pip。如果你还没有安装，先安装 Python 和 pip。\\n\\n打开终端或命令行窗口，输入以下命令安装 pwntools:\\n\\npip install pwntools\\n\\n安装完成后，您可以在 Python 脚本中导入 pwntools，例如:\\n\\nfrom pwn import *\\n\\n### 0x02 pwntools 常用模块\\n\\n```python\\nasm                  汇编与反汇编\\n\\ndynelf               远程符号泄露\\n\\nelfelf               文件操作\\n\\ngdb                  启动gdb调试\\n\\nshellcraft           shellcode的生成器\\n\\ncyclic               pattern偏移字符计算\\n\\nprocess/remote       读写接口\\n```\\n\\n### 0x03 数据交互\\n\\n```python\\n\\nio = remote(\'url\', port)        创建一个远程连接\\n\\nio = process(\\\"./文件名\\\")         创建一个本地连接\\n\\nio.send(\\\"data\\\")                 发送一行数据\\n\\nio.sendline(\\\"data\\\")             发送一行数据,并在末尾加\\\\n\\n\\nio.recv()                       接受数据\\n\\nio.recvline()                   接受一行数据\\n\\nio.interactive()                建立交互shell\\n\\n\\nio.sendafter(b\\\"some_string\\\",data)        接收到some_string后，发送payload\\n\\nio.recvuntil(b\\\"somestring\\\")              接受到some_string为止\\n\\nio.recvuntil(b\\\"\\\\n\\\", drop = True)         接受到\\\\n为止,但不包括\\\\n\\n\\n\\n```\\n\\n### 0x04 ELF 模块\\n\\n```python\\nelf = ELF(\'./文件名\')\\n\\nelf.address                     elf 基地址\\n\\nelf.bss()                       elf bss 段\\n\\nelf.plt[\'function\']             plt[] 表项对应地址\\n\\nelf.got[\'function\']             got[] 表项对应地址\\n\\nelf.symbols[\'function\']         查看对应符号函数/数据所在地址\\n\\nelf.search[\'/bin/sh\']           返回一个迭代器，用next()获取\\n\\n```\\n                                         \",\"articleCover\":\"https://upload.d1lete.online/article/8fa019d1ad4910633e77f10f346aae08.jpg\",\"articleTitle\":\"pwntools\",\"articleType\":1,\"categoryName\":\"PWN新手村\",\"id\":73,\"isRecommend\":1,\"isTop\":1,\"status\":1,\"tagNameList\":[]}]', 'PUT', '{\"code\":200,\"flag\":true,\"msg\":\"操作成功\"}', 1, '无限缤纷', '36.149.38.251', '中国|江苏省|泰州市|移动', 73, '2024-06-08 17:21:08');
